def dict_to_adj_list(dict):
    adj_list = []
    for i in range(0, len(dict)):
        adj_list.append(dict[i])
    return adj_list

def dict_to_adj_matrix(graph_dict):
    """Converts a dictionary representing a graph to an adjacency matrix."""

    nodes = list(graph_dict.keys())
    n = len(nodes)
    edges = [[False for _ in range(n)] for _ in range(n)]

    for i, node in enumerate(nodes):
        for neighbor in graph_dict[node]:
            j = nodes.index(neighbor)
            edges[i][j] = True  
    return edges

